column17:
@Harvard What's the difference between a Harvard degree and toilet paper?

When you wipe with a Harvard degree you get dirtier.

#HarvardTakesBribes

@Harvard Here is a beautiful song about Pi by #KateBush
Watch "Kate Bush - Pi (with Lyrics)" on YouTube
https://t.co/Wsjx9spZTa

@Harvard Dear Harvard,

Since your degrees are on sale, how much would it cost to make my dog an astrophysicist? I'd like at least a Masters for him. He wants to write a book and be on the History channel.

Thanks.
